import React from 'react'
import Nav from '../Components/Nav/Nav';
import styled from 'styled-components';

const ItemGrid = styled.div`
    display: grid;
    grid-template-columns: 500px 250px 250px;
    grid-gap: 10px;
`;

function ShoppingBag() {
    return (

        <>
        <Nav />

        <div style={{minHeight: 'calc(100vh - 120px)', display: 'flex', justifyContent: 'center', alignItems: 'start'}}>
            <div style={{margin: '5%'}}>
                <h1 style={{marginBottom: '10px'}}>Shopping Bag</h1>
                <div>
                    <ItemGrid>
                        <p>PRODUCT DETAILS</p>
                        <p>QTY</p>
                        <p>TOTAL</p>
                    </ItemGrid>
                </div>
            </div>

        </div>

        </>
    )
}

export default ShoppingBag
